export const mockCurrencyLayerLatestRatesFn = (
  base: string = 'EUR',
  symbols?: string[],
): Promise<ICurrencyLayerResponse.IRealTimeRates> => {
  const copyObj = { ...MOCK_CURRENCYLAYER_LATEST_RATES };
  const quotes = { ...copyObj.quotes };

  // symbols 배열이 있으면 모두 대문자로 변환
  const upperSymbols = symbols ? symbols.map((s) => s.toUpperCase()) : [];

  // quotes의 key에서 base를 제거하고 대상 통화만 추출하여, 대상 통화 코드(key)를 대문자로 만듦
  const mappedQuotes = Object.fromEntries(
    Object.entries(quotes).map(([pair, rate]) => {
      // 예: "EURUSD"에서 "USD" 추출하고 대문자로 변경
      const target = pair.substring(copyObj.source.length).toUpperCase();
      return [target, rate];
    }),
  );

  // symbols가 있다면 필터링, 없으면 전체 사용
  const filteredQuotes =
    upperSymbols.length > 0
      ? Object.fromEntries(
          Object.entries(mappedQuotes).filter(([target]) =>
            upperSymbols.includes(target),
          ),
        )
      : mappedQuotes;

  return Promise.resolve({
    ...copyObj,
    // 기존에는 quotes에 "EURUSD" 형식의 key가 있었으나,
    // 이제는 대상 통화만 남긴 형식으로 반환함.
    quotes: filteredQuotes,
  });
};

/**
 * 역사적 환율 데이터 (Historical)
 */
export const mockCurrencyLayerHistoricalRatesFn = (
  date: Date,
  base: string = 'EUR',
  symbols?: string[],
): Promise<ICurrencyLayerResponse.IHistoricalRates> => {
  const copyObj = { ...MOCK_CURRENCYLAYER_HISTORICAL_RATES };
  const quotes = { ...copyObj.quotes };
  const filteredQuotes =
    symbols && symbols.length > 0
      ? Object.fromEntries(
          Object.entries(quotes).filter(([pair]) =>
            symbols.includes(pair.replace(copyObj.source, '')),
          ),
        )
      : quotes;
  return Promise.resolve({
    ...copyObj,
    // override date with passed date if needed
    date: new Date(date),
    quotes: filteredQuotes,
  });
};

/**
 * 주어진 dayQuotes를 필터링하는 헬퍼 함수.
 * 만약 symbols 배열이 주어지면, 각 key에서 base를 제거한 후(예:"EURUSD" → "USD")
 * symbols에 포함되는 경우만 필터링하고, 결과가 빈 객체면 fallback으로 전체 데이터를 반환함.
 */
function filterDayQuotes(
  dayQuotes: Record<string, number>,
  base: string,
  upperSymbols: string[],
): Record<string, number> {
  const newDayQuotes: Record<string, number> = {};
  for (const [pair, rate] of Object.entries(dayQuotes)) {
    // base의 길이만큼 잘라내면 대상 통화 코드가 됨 (예: "EURUSD" → "USD")
    const target = pair.substring(base.length).toUpperCase();
    if (upperSymbols.length === 0 || upperSymbols.includes(target)) {
      newDayQuotes[target] = rate;
    }
  }
  // 만약 filtering 결과가 빈 객체면 fallback: 전체 데이터를 대상으로 변환
  if (Object.keys(newDayQuotes).length === 0) {
    return Object.fromEntries(
      Object.entries(dayQuotes).map(([pair, rate]) => [
        pair.substring(base.length),
        rate,
      ]),
    );
  }
  return newDayQuotes;
}

/**
 * MOCK_CURRENCYLAYER_TIMEFRAME_RATES에서 1년치 데이터(2024-02-14 ~ 2025-02-14)를
 * 받아 symbols 필터링 후 적절하게 리턴하는 함수.
 */
export const mockCurrencyLayerTimeFrameRatesFn = (
  start_date: Date,
  end_date: Date,
  base: string = 'EUR',
  symbols?: string[],
): Promise<ICurrencyLayerResponse.ITimeFrameRates> => {
  const copyObj = { ...MOCK_CURRENCYLAYER_TIMEFRAME_RATES };
  // symbols 배열이 있다면 모두 대문자로 변환
  const upperSymbols = symbols ? symbols.map((s) => s.toUpperCase()) : [];

  // 날짜별로 dayQuotes 필터링
  const filteredQuotes: Record<string, Record<string, number>> = {};
  for (const [date, dayQuotes] of Object.entries(copyObj.quotes)) {
    filteredQuotes[date] = filterDayQuotes(
      dayQuotes,
      copyObj.source,
      upperSymbols,
    );
  }

  return Promise.resolve({
    ...copyObj,
    start_date: new Date(start_date),
    end_date: new Date(end_date),
    quotes: filteredQuotes,
  });
};
